module.exports = function checkPath(obj, pathName) {
    var path = pathName.split('.');
    var p = obj;
    for (var i = 0; i < path.length; i++) {
        var partial = path[i];
        if (!(partial in p)) {
            return false;
        }
        p = p[partial]
    }
    return true;
};
